import React from "react";
import Header from "./components/Header";

function App() {
  console.log("App.js запускается"); // Этот лог должен появиться в консоли браузера
  return (
    <div>
      <Header />
      <div className="container mt-4">
        <h1>Добро пожаловать на Mashina.kg</h1>
      </div>
    </div>
  );
}

export default App;
